// export default dropdownfunction
import React from 'react';

const Dropdown = () => {
  return (
    <div className="dropdown">
      <button class="dropbtn">Dropdown</button>
      <div class="dropdown-content">
        <a href="#">Link 1</a>
        <a href="#">Link 2</a>
        <a href="#">Link 3</a>
      </div>
    </div>
  );
};

export default Dropdown;
